"use client"

// Add emojis to the university details page
import { useState, useEffect } from "react"
import { useParams, Link } from "react-router-dom"
import { fetchUniversityData } from "../services/universityService"

function UniversityDetails() {
  const { id } = useParams()
  const [university, setUniversity] = useState(null)
  const [loading, setLoading] = useState(true)
  const [error, setError] = useState("")

  useEffect(() => {
    async function loadData() {
      try {
        const data = await fetchUniversityData()
        if (data && data[id]) {
          setUniversity(data[id])
        } else {
          setError("University not found")
        }
        setLoading(false)
      } catch (err) {
        setError("Failed to load university data")
        setLoading(false)
      }
    }

    loadData()
  }, [id])

  if (loading) {
    return (
      <div className="flex justify-center items-center h-64">
        <div className="text-xl font-semibold">Loading... ⏳</div>
      </div>
    )
  }

  if (error || !university) {
    return (
      <div className="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded">
        {error || "University not found"} 😕
      </div>
    )
  }

  // Parse clubs and societies
  const clubs = university.Clubs_Societies ? university.Clubs_Societies.split(",").map((club) => club.trim()) : []

  // Parse scholarships
  const scholarships = university.Scholarship_Availability
    ? university.Scholarship_Availability.split(",").map((scholarship) => scholarship.trim())
    : []

  return (
    <div className="max-w-4xl mx-auto">
      <div className="mb-6">
        <Link to="/" className="text-blue-500 hover:text-blue-700">
          ← Back to Dashboard
        </Link>
      </div>

      <div className="bg-white rounded-lg shadow-md overflow-hidden">
        <div className="h-48 bg-gray-200 flex items-center justify-center">
          <span className="text-gray-500 text-lg">🏛️ University Image</span>
        </div>

        <div className="p-6">
          <h1 className="text-3xl font-bold mb-2">🏛️ {university.Name}</h1>
          <p className="text-xl text-gray-600 mb-6">📍 {university.Location}</p>

          <div className="grid grid-cols-1 md:grid-cols-2 gap-8 mb-8">
            <div>
              <h2 className="text-xl font-semibold mb-4">📊 Key Information</h2>
              <div className="space-y-3">
                <div>
                  <span className="font-medium">🏆 Ranking:</span> {university.Ranking}
                </div>
                <div>
                  <span className="font-medium">👨‍🏫 Student to Faculty Ratio:</span>{" "}
                  {university.Student_to_Faculty_Ratio}
                </div>
                <div>
                  <span className="font-medium">💼 Employment Rate:</span> {university.Employment_Rate_After_Graduation}
                  %
                </div>
                <div>
                  <span className="font-medium">🌎 International Students:</span>{" "}
                  {university.International_Student_Population}
                </div>
                <div>
                  <span className="font-medium">🏠 On-Campus Accommodation:</span> {university.On_Campus_Accommodation}
                </div>
                <div>
                  <span className="font-medium">🔬 Research Opportunities:</span> {university.Research_Opportunities}
                </div>
                <div>
                  <span className="font-medium">✈️ Exchange Program:</span> {university.Exchange_Students_Acceptance}
                </div>
              </div>
            </div>

            <div>
              <h2 className="text-xl font-semibold mb-4">💰 Tuition Fees</h2>
              <div className="space-y-3">
                <div>
                  <span className="font-medium">🎓 Undergraduate:</span> {university.UG_Tuition_Fee}
                </div>
                <div>
                  <span className="font-medium">🎓🎓 Masters:</span> {university.Masters_Tuition_Fee}
                </div>
              </div>

              {scholarships.length > 0 && (
                <div className="mt-6">
                  <h3 className="text-lg font-semibold mb-2">🏆 Scholarships</h3>
                  <ul className="list-disc pl-5 space-y-1">
                    {scholarships.map((scholarship, index) => (
                      <li key={index}>{scholarship}</li>
                    ))}
                  </ul>
                </div>
              )}
            </div>
          </div>

          {clubs.length > 0 && (
            <div className="mb-8">
              <h2 className="text-xl font-semibold mb-4">🎭 Clubs & Societies</h2>
              <div className="flex flex-wrap gap-2">
                {clubs.map((club, index) => (
                  <span key={index} className="bg-blue-100 text-blue-800 px-3 py-1 rounded-full text-sm">
                    {club}
                  </span>
                ))}
              </div>
            </div>
          )}

          <div className="mt-8 flex justify-center">
            <Link
              to="/questionnaire"
              className="bg-green-500 hover:bg-green-700 text-white font-bold py-2 px-4 rounded mr-4"
            >
              Find More Universities 🔍
            </Link>
            <button
              className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded"
              onClick={() =>
                window.open(`https://www.google.com/search?q=${encodeURIComponent(university.Name)}`, "_blank")
              }
            >
              Visit Website 🌐
            </button>
          </div>
        </div>
      </div>
    </div>
  )
}

export default UniversityDetails
